import React from 'react'

const FullcarsCard = () => {
    const cars = [
        {
          name: 'Creta Hyundai (SIX)',
          details: '5: 6: 2 Auto Mbogo AC',
          features: [
            'Free Consolidation',
            'Internally Confirmed',
            'Price Guarantee',
            'Title/Party Mobility',
          ],
          image: 'https://via.placeholder.com/300x200', // Replace with actual image URL
        },
        {
          name: 'Innova Crystal (Economy)',
          details: '7: 8: 1 Manual Mboggo AC',
          features: [
            'Free Consolidation',
            'Internally Confirmed',
            'Price Guarantee',
            'Title/Party Mobility',
          ],
          image: 'https://via.placeholder.com/300x200', // Replace with actual image URL
        },
        {
          name: 'Toyota Etios (Compact)',
          details: '5: 6: 2 Manual Mboggo AC',
          features: [
            'Free Consolidation',
            'Internally Confirmed',
            'Price Guarantee',
            'Title/Party Mobility',
          ],
          image: 'https://via.placeholder.com/300x200', // Replace with actual image URL
        },
        {
          name: 'Mahindra XUV500 (Economy)',
          details: '7: 8: 1 Manual Mboggo AC',
          features: [
            'Free Consolidation',
            'Internally Confirmed',
            'Price Guarantee',
            'Title/Party Mobility',
          ],
          image: 'https://via.placeholder.com/300x200', // Replace with actual image URL
        },
      ];
    
      const offers = [
        { discount: '10X Offi', originalPrice: '$250', discountedPrice: '$210', perDay: 'per day' },
        { discount: '10X Offi', originalPrice: '$350', discountedPrice: '$351', perDay: 'per day' },
        { discount: '20X Offi', originalPrice: '$240', discountedPrice: '$192', perDay: 'per day' },
        { discount: '15X Offi', originalPrice: '$440', discountedPrice: '$374', perDay: 'per day' },
      ];
  return (
    <div className="p-4 bg-gray-100">
      {/* Car List Section */}
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4 mb-8">
        {cars.map((car, index) => (
          <div key={index} className="bg-white rounded-lg shadow-md overflow-hidden">
            {/* Car Image */}
            <img
              src={car.image}
              alt={car.name}
              className="w-full h-48 object-cover"
            />

            {/* Car Details */}
            <div className="p-6">
              <h2 className="text-xl font-bold mb-2">{car.name}</h2>
              <p className="text-gray-700 mb-4">{car.details}</p>
              <ul className="text-gray-600">
                {car.features.map((feature, idx) => (
                  <li key={idx} className="mb-2">â€¢ {feature}</li>
                ))}
              </ul>
            </div>
          </div>
        ))}
      </div>

      {/* Offers Section */}
      <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-4 gap-4">
        {offers.map((offer, index) => (
          <div key={index} className="bg-white rounded-lg shadow-md p-6 text-center">
            <h3 className="text-lg font-bold mb-2">{offer.discount}</h3>
            <p className="text-gray-700">
              <span className="line-through">{offer.originalPrice}</span>{' '}
              <span className="text-green-600 font-bold">{offer.discountedPrice}</span>
            </p>
            <p className="text-gray-600">{offer.perDay}</p>
            <button className="mt-4 bg-blue-600 text-white py-2 px-6 rounded-lg hover:bg-blue-700">
              Book Now
            </button>
          </div>
        ))}
      </div>
    </div>
  )
}

export default FullcarsCard
